import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <h2>Hi, my name is Jimmy.</h2>
        <p>This is the home page for my website. Despite having multiple separate views, this is technically a "one-page" website.</p>

        <p>Duis a turpis sed lacus dapibus elementum sed eu lectus.</p>
      </div>
    );
  }
}

export default Home;
